import React, { PureComponent } from 'react';
import {
  Text,
  View,
  Image,
  ImageBackground
} from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { connect } from 'react-redux';

class MurderSuspectListItem extends PureComponent {
  onPress = () => {
    const { id, onPressItem, listType } = this.props;
    const index = id;
    onPressItem(listType, index);
  };

  render() {
    const {
      image,
      title,
      trailSave,
      listType,
      id
    } = this.props;
    const imgX = '';
    const imageURI = `data:image/png;base64,${image.data}`;
    const imageScaler = 1.5;
    const imageHeight = (image.height) * imageScaler - 6;
    const imageWidth = (image.width) * imageScaler - 10;

    const textStyle = [{ width: (image.width * imageScaler) - 10 }, Styles.text];
    const imageStyle = [{
      height: imageHeight,
      width: imageWidth,
      marginLeft: 'auto',
      marginRight: 'auto',
      marginTop: 5,
      marginBottom: 5,
    }];
    const xStyle = [
      { width: imageWidth, height: imageHeight, opacity: 0 }
    ];

    if (trailSave[listType][id]) {
      textStyle.push({
        textDecorationLine: 'line-through'
      });
      xStyle.push({ opacity: 1 });
      imageStyle.push({ opacity: 0.5 });
    }

    return (
      <TouchableOpacity onPress={this.onPress}>
        <View style={{ width: ((image.width) * imageScaler), marginBottom: 5, marginRight: 2 }}>
          <ImageBackground
            style={imageStyle}
            source={{ uri: imageURI }}
          >
            <Image
              source={{ uri: `data:image/png;base64,${imgX}` }}
              style={xStyle}
            />
          </ImageBackground>
          <Text style={textStyle}>
            {title}
          </Text>
        </View>
      </TouchableOpacity>
    );
  }
}

const Styles = {
  text: {
    textAlign: 'center',
    marginLeft: 'auto',
    marginRight: 'auto'
  },
  textDisabled: {
    textAlign: 'center',
    marginLeft: 'auto',
    marginRight: 'auto',
    textDecorationLine: 'line-through'
  }
};

const mapStateToProps = (state, ownProps) => {
  const { trailState } = state;
  const {
    save,
    selectedTrail
  } = trailState;
  return ({
    ...ownProps,
    trailSave: save[selectedTrail]
  });
};

export default connect(mapStateToProps)(MurderSuspectListItem);
